import React from "react"
import {TextField} from "@material-ui/core"


export const CustomField = ({setFieldValue, ...props}) => {

    const handler = ({target}) => {
        target.value = `+998${target.value}`;

        setFieldValue(props.name, target);
    };

    return <TextField
        fullWidth
        focused={false}
        variant='outlined'
        onChange={handler}
        {...props}
    />
};
